import './App.css';
import { Outlet } from "react-router-dom";
import 'animate.css';

import React from 'react';
import { getTranslation, setLanguage } from './Lang/LanguageManager';

const App = () => {
  return (
    <div className='App'>
      <div style={{color:'#fff'}}>
        <h1>{getTranslation('welcome')}</h1>
        <p>{getTranslation('hello')}</p>
        <button onClick={() => setLanguage('tr')}>Türkçe</button>
        <button onClick={() => setLanguage('en')}>English</button>
      </div>

      <Outlet />
    </div>
  );
};

export default App;
